function EditToDoItem() {
    return (
        <div className="form">
            <form onSubmit={(e) => {
                e.preventDefault();
                }}>
                <input />
                    <button type="submit">
                        <span>Edit</span>
                    </button>
            </form>
    </div>
    )
}

export default EditToDoItem;
